  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:22.414700\",\n\t\"name\": \"survey-for-contaminants-in-sediments-in-pigeon-creek-at-crab-orchard-national-wildlife-ref\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A survey for environmental contaminants
  was conducted by the U.S. Fish and Wildlife Service personnel in 1986 which included
  several locations on Crab Orchard National Wildlife Refuge (CONWR). During this
  survey, small concentrations of polychlorinated biphenyls (PBCs) were detected in
  the Pigeon Creek, a small stream located along the northern edge of Crab Orchard
  Lake. A follow-up survey was initiated in 1988 to make a further determination of
  specific areas of potential PCB contamination in Pigeon Creek.\",\n\t\"license_title\":
